  `engage_dl_flg` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '割当済ダウンロードフラグ',
  `cancel_dl_flg` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '解約ダウンロードフラグ',
  `staff_id` varchar(15) NOT NULL COMMENT '発注担当者ID',
  `staff_name` varchar(30) NOT NULL COMMENT '発注担当者名',
  `release_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '仕入解約日'
